int lengthOfLongestSubstring(char *s) {
    char *str = s;
    char *subStr = (char *) calloc(1, strlen(s) + 1);
    char *subStrOut = (char *) calloc(1, strlen(s) + 1);

    for (int i = 0; i < strlen(str); ++i) {
        bool flag = false;
        for (int j = 0; j < strlen(subStr); ++j) {
            if (subStr[j] == str[i]) {
                flag = true;
                break;
            }
        }

        if (!flag) {
            subStr[i] = str[i];
        } else {
            if (strlen(subStr) > strlen(subStrOut)) {
                memcpy(subStrOut, subStr, strlen(subStr) + 1);
            }
            memset(subStr, 0, strlen(subStr) + 1);
            str++;
            i = -1;
        }


    }

    printf("substr MAX: %s\n", subStrOut);
    size_t subLen = (strlen(subStr) > strlen(subStrOut))?strlen(subStr):strlen(subStrOut);
    return (int)subLen;
}

